export default (function(a,b,c,d,e,f,g,h,i,j,k){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:e,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:e,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:f,pageSize:25,pageCount:f,total:5}}},KJnRNyUozd:{data:{id:2496,attributes:{imdbId:"tt1002563",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTU4NzM3NzczMF5BMl5BanBnXkFtZTgwMzM0NjkwNzE@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"5.7\u002F10"},{Source:"Rotten Tomatoes",Value:"50%"},{Source:"Metacritic",Value:"33\u002F100"}],item_lang:{data:{id:3159,attributes:{title:"The Young Messiah",plot:"At the age of 7, Jesus Bar-Joseph lives with his family in Alexandria, Egypt, where they have fled to avoid a massacre of children by King Herod of Israel. Jesus knows that his parents Joseph and Mary have secrets they are keeping from him, secrets about his birth and about traits that make him very different from other boys. His parents, however, believe him too young to grasp the truth of his miraculous birth and purpose. Learning that the murderous Herod is dead, they set out to return to their home of Nazareth in Israel, unaware that Herod's namesake son is, like his father, determined to see the boy Jesus dead.",slug:"the-young-messiah"}}},books:{data:[{id:1552,attributes:{title:"Christ the Lord",description:"Incorporates the latest New Testament scholarship to offer a fictional chronicle of the early years of Jesus Christ.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=RxFmAAAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:true,published:"2005-01-01",publisher:"Alfred a Knopf Incorporated",subtitle:"Out of Egypt : a Novel"}},{id:1553,attributes:{title:"The Young Messiah (Movie tie-in) (originally published as Christ the Lord: Out of Egypt)",description:"NOW A MAJOR MOTION PICTURE With the Holy Land in turmoil, seven-year-old Jesus and his family leave Egypt for the dangerous road home to Jerusalem. As they travel, the boy ponders the mysteries surrounding his birth. Anne Rice’s dazzling, kaleidoscopic novel, based on the gospels and the most respected New Testament scholarship, summons up the voice, the presence, and the words of Jesus, allowing him to tell his own story as he struggles to grasp the holy purpose of his life. Praise for The Young Messiah “[An] intensely literal, historical, reverent treatment of a year in the life of Jesus, Son of God.”—Time “Brilliant and tangible . . . Rice retains our rapt attention.”—Los Angeles Times “Emotionally engaging and often moving; Ms. Rice succeeds in creating a Jesus who is recognizably human.”—National Catholic Reporter “An inestimably valuable contribution to the discussion of Christian history as well as a tender look at the young Jesus.”—The Denver Post Previously published as Christ the Lord: Out of Egypt",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=-RyoCgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:"2016-01-26",publisher:"Ballantine Books",subtitle:d}},{id:1554,attributes:{title:g,description:h,thumbnail:i,authors:[a],firstBook:c,published:j,publisher:k,subtitle:d}},{id:1555,attributes:{title:g,description:h,thumbnail:i,authors:[a],firstBook:c,published:j,publisher:k,subtitle:d}},{id:1556,attributes:{title:"Christ the Lord: The Road to Cana",description:"NATIONAL BESTSELLER • The second novel in Anne Rice's hugely ambitious, moving, and masterful portrayal of the life of Christ, following Christ the Lord: Out of Egypt. It’s a winter of no rain, endless dust, and talk of trouble in Judea. All who know and love Jesus find themselves waiting for some sign of the path he will eventually take. After his baptism, he is at last ready to confront his destiny. At the wedding at Cana, he takes water and transforms it into red wine. Thus, he’s recognized as the anointed one and called by God the Father to begin a ministry that will transform an unsuspecting world.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=QsHV0iJ2CzAC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:"2008-03-04",publisher:"Anchor",subtitle:""}}]}}},meta:{}}},prerenderedAt:1681377201698}}("Anne Rice","movie",null,"A Novel","series",1,"Christ the Lord: Out of Egypt","Having completed the two cycles of legend to which she has devoted her career so far, Anne Rice gives us now her most ambitious and courageous book, a novel about the early years of CHRIST THE LORD, based on the Gospels and on the most respected New Testament scholarship. The book’s power derives from the passion its author brings to the writing and the way in which she summons up the voice, the presence, the words of Jesus who tells the story.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=TA-oKWssqRIC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2011-08-10","Fawcett"))